"use strict";

function countHillValley(nums) {
    let ans = 0, j = 0;
    for (let i = 1; i < nums.length - 1; i++) {
        if (nums[i] === nums[i + 1]) {
            continue;
        }
        if (nums[i] > nums[j] && nums[i] > nums[i + 1]) {
            ans += 1;
        }
        if (nums[i] < nums[j] && nums[i] < nums[i + 1]) {
            ans += 1;
        }
        j = i;
    }
    return ans;
}
